import { UserContext, listContext } from "../../App";

function UseContextHook() {
  return (
    <div>
      <UserContext.Consumer>
       {user =>{
        return(
          <>
          {user}
          </>
        )
       }}
      </UserContext.Consumer>
    </div>
  );
}

export default UseContextHook;
